import React from 'react';
import './App.css';
import SimpleCard from './Card';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid container spacing={3} direction='column' className="App">
      <Grid item>This is where the header will be</Grid>
      <Grid>
          <Grid item xs={0} sm={1} />
          <Grid item>
            <SimpleCard />
          </Grid>
          <Grid item>
            <SimpleCard />
          </Grid>
          <Grid item>
            <SimpleCard />
          </Grid>
          <Grid item>
            <SimpleCard />
          </Grid>
          <Grid item>
            <SimpleCard />
          </Grid>
          <Grid item xs={0} sm={1} />
      </Grid> 
    </Grid>
  );
}

export default App;
